// Get hexamer frequency (0.0 for invalid hexamers)
inline float get_hexamer_freq(const char* seq) {
    uint32_t code = encode_hexamer(seq);
    if (code == UINT32_MAX || code >= 4096) return 0.0f;
    return GTDB_HEXAMER_FREQ[code];
}

// Mean frequency for normalization
static constexpr float GTDB_HEXAMER_MEAN = 0.000244140625f;  // 1/4096
// Max frequency for scaling
static constexpr float GTDB_HEXAMER_MAX = 0.00249376f;  // GCCGCC

